import MiloImage from '../assets/milo.jpg';
import niveaImage from '../assets/nivea.jpg';
import iceCreamImage from '../assets/ice-cream.jpg';
const products = [
  {
    id: 1,
    name: 'Milo',
    price: 5.99,
    image: MiloImage,
    category: 'Beverages'
  },
  {
    id: 2,
    name: 'Nivea',
    price: 7.23,
    image: niveaImage,
    category: 'Body-Cream'
  },
  {
    id: 3,
    name: 'Ice Cream',
    price: 2.81,
    image: iceCreamImage,
    category: 'Desserts'
  },
  {
    id: 4,
    name: 'Gaming Mouse',
    price: 29.99,
    image: 'https://via.placeholder.com/300x300?text=Gaming+Mouse',
    category: 'Gaming'
  },
  {
    id: 5,
    name: 'Laptop Bag',
    price: 49.99,
    image: 'https://via.placeholder.com/300x300?text=Laptop+Bag',
    category: 'Accessories'
  }
];

export default products;
